import TabProducts from "./Home/TabProducts";
import TopProducts from "./Home/TopProducts";

export default function Home() {
  useEffect(() => {
    // window.location.reload();
  }, []);
  return (
    <div>
      <Slider />
      <Banner />
      <TabProducts />
      <Advertisement />
      <TopProducts />
      <BlogPage />
      <button id="scroll-top" title="Back to Top">
        <i class="icon-arrow-up"></i>
      </button>
    </div>
  );
}
